import React from 'react';
import Sidebar from '../components/Sidebar/Sidebar';
import MessageDetail from '../components/ContractMessages/MessageDetail';
import './styles.css';

const ContractMessageDetailsPage = () => {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <MessageDetail />
    </div>
  );
};

export default ContractMessageDetailsPage;
